pragma solidity ^0.8.0;

import '@openzeppelin/contracts/token/ERC1155/IERC1155.sol';
import './IToken.sol';
import "@openzeppelin/contracts/token/ERC1155/utils/ERC1155Receiver.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

import "hardhat/console.sol";

contract Holder is ERC1155Receiver {

    IERC1155 private _IERC1155;
    IToken private _IToken;
    
    constructor(IERC1155 ERC1155Address, IToken TokenAddress) {
        _IERC1155 = ERC1155Address;
        _IToken = TokenAddress;
    }

    function onERC1155Received(
        address from,
        address,
        uint256,
        uint256,
        bytes memory
    ) public virtual override returns (bytes4) {
        console.log('hello');
        _IToken.mint(from, 1);
        return this.onERC1155Received.selector;
    }


    function onERC1155BatchReceived(
        address,
        address,
        uint256[] memory,
        uint256[] memory,
        bytes memory
    ) public virtual override returns (bytes4) {
        return this.onERC1155BatchReceived.selector;
    }
    
    function transferItems(uint256 _itemId, uint256 _amount, address _from, address _to) external {
        require(_IERC1155.balanceOf(_from, _itemId) >= _amount);
        _IERC1155.safeTransferFrom(_from, _to, _itemId, _amount, "");
    }

